import React from "react";

const App = () => {
  const onClickButton = () =>alert()
  const colorSample = {color : "red"}
  return (
    <>
      <h1 style={{colorSample}}>こんにちは</h1>
      <p>エクスポートとインポートの確認</p>
      <button onClick={onClickButton}>ボタン</button>
    </>
  )
};

export default App;
